import React from "react";

const Cards = ({ results }) => {
  let display;

  if (results) {
    display = results.map((result) => {
      return (
        <div className="col-4" key={result.id}>
          <div className="">
            <img src={result.image} alt="" className="img-fluid" />
            <div className="content">{result.name}</div>
          </div>
        </div>
      );
    });
  } else {
    display = "No characters found! :(";
  }

  return <>{display}</>;
};

export default Cards;
